var agreementRate_human = {};

for(var q=1; q<=20; q++) {
	agree_AI['q' + q] = total_AI['q' + q] = agreementRate_AI['q' + q] = 0;
	agree_human['q' + q] = total_human['q' + q] = agreementRate_human['q' + q] = 0;
}

for(var key in AIRecord) {
	var answers = AIRecord[key]['answer'];
	for(var q in answers) {
		if(option_type == 'all' || answers[q]['option_type'] == option_type) {
			total_AI[q]++;
			qCount++;
			if(answers[q]['agree'] == true) agree_AI[q]++;
		}
	}
}

for(var key in humanRecord) {
	var answers = humanRecord[key]['answer'];
	for(var q in answers) {
		if(option_type == 'all' || answers[q]['option_type'] == option_type) {
			total_human[q]++;
			qCount++;
			if(answers[q]['agree'] == true) agree_human[q]++;
		}
	}
}

for(var q=1; q<=20; q++) {
	agreementRate_AI['q' + q] = agree_AI['q' + q] / total_AI['q' + q];
	agreementRate_human['q' + q] = agree_human['q' + q] / total_human['q' + q];
}

console.log("Total answers recorded", qCount);
console.log("Agreement rate");
for(var key in agreementRate_AI) {
	var percentAI = (agreementRate_AI[key]*100).toFixed(2);
	var percentHuman = (agreementRate_human[key]*100).toFixed(2);
	console.log("Question", key, "AI", percentAI, "% vs human", percentHuman, "%");
}

total_agree_AI = 0;
total_agree_human = 0;
total_count = 0;

for(var q=1; q<=20; q++) {
	// Remove photo questions.
	// if(q >= 10 && q <= 14) continue;
	// if(q == 19 || q == 20) continue;
	total_agree_AI += agreementRate_AI['q' + q];
	total_agree_human += agreementRate_human['q' + q];
	total_count++;
}

console.log('Final agreement rate:', 'AI', (total_agree_AI / total_count * 100).toFixed(2), 'human', (total_agree_human / total_count * 100).toFixed(2));